  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The dataset includes is the number of
  Qualified Health Plan selections by ZIP code for 36 states that are participating
  in the Federally-facilitated Marketplace or have State Partnership Marketplaces
  or supported State-based Marketplaces for the initial open enrollment period from
  October 1, 2013 through March 31, 2014, including additional special enrollment
  period activity reported through April 19, 2014.  Marketplace plan selections are
  tabulated by ZIP Code according to the home address provided by the applicant.</p>n\",\n\t\"license_title\":
